##### \xe4\xbd\xbf\xe7\x94\xa8\xe4\xbb\xa3\xe7\xa0\x81

+ **\xe5\x88\x9b\xe5\xbb\xba ForceAtlas2 \xe5\xae\x9e\xe4\xbe\x8b**

```javascript
var forceAtlas2 = new ForceAtlas2();
```

+ **\xe6\xb7\xbb\xe5\x8a\xa0\xe8\x8a\x82\xe7\x82\xb9**

```javascript

// \xe5\x8f\xaf\xe4\xbb\xa5\xe4\xbd\xbf\xe7\x94\xa8 ForceAtlas2.Node \xe5\x88\x9b\xe5\xbb\xba\xe8\x8a\x82\xe7\x82\xb9
var position = new Float32Array([10, 10]);
forceAtlas2.addNode(new ForceAtlas2.Node("", position));

// \xe4\xb9\x9f\xe5\x8f\xaf\xe4\xbb\xa5\xe4\xbc\xa0\xe5\x85\xa5\xe4\xbb\xbb\xe6\x84\x8f\xe5\xb8\xa6\xe6\x9c\x89 position \xe5\xb1\x9e\xe6\x80\xa7\xe7\x9a\x84 object
var position = new Float32Array([10, 10]);
forceAtlas2.addNode({
    position: position,
    id: "",
    mass: 1,
    size: 1
});

```

\xe5\x85\xb6\xe4\xb8\xad `id`, `mass`, `size` \xe5\xb1\x9e\xe6\x80\xa7\xe9\x83\xbd\xe6\x98\xaf\xe5\x8f\xaf\xe9\x80\x89\xe7\x9a\x84

+ **\xe6\xb7\xbb\xe5\x8a\xa0\xe8\xbe\xb9**

\xe8\xb7\x9f\xe6\xb7\xbb\xe5\x8a\xa0\xe8\x8a\x82\xe7\x82\xb9\xe7\xb1\xbb\xe4\xbc\xbc

```javascript
// \xe5\x8f\xaf\xe4\xbb\xa5\xe4\xbd\xbf\xe7\x94\xa8 ForceAtlas2.Edge \xe5\x88\x9b\xe5\xbb\xba\xe8\xbe\xb9
forceAtlas2.addEdge(new ForceAtlas2.Edge(sNode, tNode));

// \xe4\xb9\x9f\xe5\x8f\xaf\xe4\xbb\xa5\xe4\xbc\xa0\xe5\x85\xa5\xe4\xbb\xbb\xe6\x84\x8f\xe5\xb8\xa6\xe6\x9c\x89 source \xe5\x92\x8c target \xe5\xb1\x9e\xe6\x80\xa7\xe7\x9a\x84 object
forceAtlas2.addEdge({
    source: sNode,
    target: tNode
});
```

+ **\xe5\x88\x9d\xe5\xa7\x8b\xe5\x8c\x96**

\xe5\x88\x9d\xe5\xa7\x8b\xe5\x8c\x96\xe4\xbc\x9a\xe5\x88\x9b\xe5\xbb\xba\xe4\xb8\x80\xe4\xb8\xaa worker \xe5\xb9\xb6\xe6\x8a\x8a\xe9\xa1\xb6\xe7\x82\xb9\xe5\x92\x8c\xe8\xbe\xb9\xe7\x9a\x84\xe5\x88\x9d\xe5\xa7\x8b\xe6\x95\xb0\xe6\x8d\xae\xe4\xbc\xa0\xe5\x88\xb0 worker \xe4\xb8\xad

```javascript
